import './App.css';
import Navbar from './Components/Navbar/Navbar';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import ShopCategory from './Pages/ShopCategory';
import LoginSignup from './Pages/LoginSignup';
function App() {
  return (
    <div >
      <BrowserRouter>
    <Navbar/>
    <Routes>
      <Route path ='/' element={<Shop/>}/>
      <Route path='/indoor' element={<ShopCategory category="indoor"/>}/>
      <Route path='/outdoor' element={<ShopCategory category="outdoor"/>}/>
      <Route path='/succelent' element={<ShopCategory category="succelent"/>}/>
      <Route path='/fertilize' element={<ShopCategory category="fertilize"/>}/>
      <Route path='/iproduct' element={<Product category="product"/>}/>
      <Route path='/productId' element={<Product category="indoor"/>}/>
      <Route path='/cart' element={<Cart category="indoor"/>}/>
      <Route path='/login' element={<LoginSignup c/>}/>
    </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
